        [Theory]
        [MemberData(nameof(UnitTypes))]
        public void ToUnit(ElectricPotentialChangeRateUnit unit)
        {
            var inBaseUnits = ElectricPotentialChangeRate.From(1.0, ElectricPotentialChangeRate.BaseUnit);
